  return(
    <div>
      <div className='bar'>
        <img className='Logo' src={Logo} alt='Logo'/>
        <h className='call_number'> CALL US (844) 811-1112 </h>

        <p><Icon name='rocketchat' size='large'/></p>

      </div>

    </div>
  )
}
export default header;
